const e=JSON.parse(`{"key":"v-53c65fa2","path":"/imports/multiple-sheets.html","title":"Multiple Sheets","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"Selecting sheets by worksheet index","slug":"selecting-sheets-by-worksheet-index","link":"#selecting-sheets-by-worksheet-index","children":[]},{"level":2,"title":"Selecting sheets by worksheet name","slug":"selecting-sheets-by-worksheet-name","link":"#selecting-sheets-by-worksheet-name","children":[]},{"level":2,"title":"Skipping unknown sheets","slug":"skipping-unknown-sheets","link":"#skipping-unknown-sheets","children":[{"level":3,"title":"Skipping only specific sheets","slug":"skipping-only-specific-sheets","link":"#skipping-only-specific-sheets","children":[]}]},{"level":2,"title":"Conditional sheet loading","slug":"conditional-sheet-loading","link":"#conditional-sheet-loading","children":[]},{"level":2,"title":"Making calculations work when referencing between sheets","slug":"making-calculations-work-when-referencing-between-sheets","link":"#making-calculations-work-when-referencing-between-sheets","children":[]}],"git":{"createdTime":1704429178000,"updatedTime":1704429178000,"contributors":[{"name":"Moments","email":"554676262@qq.com","commits":1}]},"readingTime":{"minutes":2.31,"words":694},"filePathRelative":"imports/multiple-sheets.md","localizedDate":"January 5, 2024","excerpt":"<h1> Multiple Sheets</h1>\\n\\n<p>When a file has multiple sheets, each sheet will go through the import object. If you want to handle each sheet separately, you'll need to implement the <code>WithMultipleSheets</code> concern.</p>\\n<p>The <code>sheets()</code> method expects an array of sheet import objects to be returned. The order of the sheets is important, the first sheet import object in the array will automatically be linked to the first worksheet in the Excel file.</p>"}`);export{e as data};
